<p>D&eacute;sactiv&eacute; le 01/07/2015</p>', 'info', 1, 1, 18, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (2, 'Paiement de 20 € 9-25', '<p>Il ne lui reste que 10 &euro; or il y a un paiement 20 &euro;</p>', 'info', 1, 1, 153, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (3, 'Appel pour inscription', '<p>Message laiss&eacute; sur repondeur</p>', 'warning', 4, 1, 72, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (4, 'Appel pour inscription', '<p>Message laiss&eacute; sur repondeur</p>', 'warning', 1, 1, 73, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (5, 'Appel pour inscription', '<p>Message laiss&eacute; sur repondeur</p>', 'warning', 1, 1, 188, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (6, 'Trop payé sur l''année 2015', '<p>Il lui est du 10&nbsp;&euro;</p>', 'danger', 1, 1, 111, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (7, 'mettre a jour', '<p>la date de naissance</p>', 'info', 8, 1, 228, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (8, 'Desincription pour demenagement', '<p>Assia demenage a la maison blanche, du fait de la distance, elle ne peut continuer l&#39;ann&eacute;e selon les parents</p>', 'info', 1, 1, 180, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (9, 'Forfait 2015/2016', '<p>30 &euro; pay&eacute; en plus</p>', 'info', 1, 1, 128, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (10, 'Relance paiement', '<p>Je n&#39;ai eu personne, &agrave; rappeller pour avoir le p&egrave;re</p>', 'Information', 1, 1, 153, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (11, '2018-2019 - Forfait', '<p>Reste 100 &euro; &agrave; payer, la m&egrave;re a dit qu&#39;elle fera le necessaire ce mois-ci</p>', 'Information', 1, 1, 437, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (12, '2018-2019 - Forfait', '<p>Appel, mais pas de r&eacute;ponse je laisse un mot &agrave; Farda</p>', 'Avertissement', 1, 1, 471, '2020-06-07 09:58:52', '2020-06-07 09:58:52'), (13, 'supprimer ou desactiver', '<p>pourrais tu supprimer&nbsp;cet eleve ainsi que d&#39;autres qu